import React from 'react'

const Course = ( {course} ) => {
	const total = course.parts.map(ex => ex.exercises)

console.log(total)
	return (
		<div>
			{/* <h1>{course.name}</h1> */}
			<Header name={course.name}></Header>
			<ul>
			{course.parts.map(part => 
			<li key={part.id}>
				{part.name} {part.exercises}
				</li>)}
			</ul>
			<strong>total of exercises {total} exercises</strong>
		</div>
	)
}

const App = () => {
	const course = {
	  id: 1,
	  name: 'Half Stack application development',
	  parts: [
		{
		  name: 'Fundamentals of React',
		  exercises: 10,
		  id: 1
		},
		{
		  name: 'Using props to pass data',
		  exercises: 7,
		  id: 2
		},
		{
		  name: 'State of a component',
		  exercises: 14,
		  id: 3
		}
	  ]
	}

	return <Course course={course} />
  }

  export default App
